const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`RedisInsight, a free GUI for Redis, allows you to identify and troubleshoot bottlenecks with the Slowlog analysis tool. If you are experiencing high latency and high CPU usage with Redis operations and looking for a tool for debugging and tracing your Redis database, RedisInsight Slow Log is a perfect tool for you.`}</p>
    <p>{`Redis Slow Log is highly effective at showing the actual processing time of each slow command. The Redis slowlog is a log of all commands which exceed a specified run time. Please note that the network latency is not included in the measurement, just the time taken to actually execute the command. Redis Slow Log is a list of slow operations for your Redis instance.`}</p>
    <p>{`Follow the below steps to see how Slowlog is leveraged to troubleshoot performance issues.`}</p>
    <h2 {...{
      "id": "step-1-create-a-redis-database"
    }}>{`Step 1. Create a Redis database`}</h2>
    <p>{`Follow `}<a parentName="p" {...{
        "href": "https://developer.redislabs.com/create"
      }}>{`https://developer.redislabs.com/create`}</a>{` to install and create Redis database`}</p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <h2 {...{
      "id": "step-3-connect-to-the-database-using-redisinsight-gui"
    }}>{`Step 3. Connect to the database using RedisInsight GUI`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-4-click-slowlog-and-then-configure-slowlog"
    }}>{`Step 4: Click “Slowlog” and then “Configure Slowlog”`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-5-configure-slowlog"
    }}>{`Step 5. Configure Slowlog`}</h2>
    <p>{`There are two configurations related to slowlog query - `}</p>
    <ul>
      <li parentName="ul">{`slowlog-log-slower-than: Used to set the evaluation time of slow query, that is to say, commands that exceed this configuration item will be treated as slow operations and recorded in the slow query log. Its execution unit is microseconds (1 second equals 1000000 microseconds);`}</li>
      <li parentName="ul">{`slowlog-max-len: Used to configure the maximum number of records in the slow query log.`}</li>
    </ul>
    <p>{`Please note that a negative number disables the slowlog, while a value of zero forces the logging of every command. Slowlog-max-len is the length of the slowlog. The minimum value is zero. When a new command is logged and the slowlog is already at its maximum length, the oldest one is removed from the queue of logged commands in order to make space. The configuration can be done by editing redis.conf or while the server is running using the CONFIG GET and CONFIG SET commands.`}</p>
    <p>{`Slowlog will log the last X number(amount) of queries which took more time than Y microseconds to run. You can set this either in redis.conf or at runtime using CONFIG command`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` CONFIG SET slowlog-log-slower-than 500
 CONFIG SET slowlog-max-len 50
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-6-prepare-a-script-to-add-large-dataset-to-redis-database"
    }}>{`Step 6. Prepare a script to add large dataset to Redis database`}</h2>
    <p>{`To see slowlog in action, let us pick up a large dataset. Create a file called importcities.py and add the below content:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{` import csv
 import config
 from redis import Redis

 # Database Connection
 host = config.REDIS_CFG["host"]
 port = config.REDIS_CFG["port"]
 pwd = config.REDIS_CFG["password"]
 redis = Redis(host=host, port=port, password=pwd, charset="utf-8", decode_responses=True)

 # Import Cities
 print("Importing ...")

 count = 0

 with open("data/worldcities.csv", 'r') as cities:
    reader = csv.DictReader(cities)
    for row in reader:
        id = row["id"]
        name = row["city_ascii"]
        lng = row["lng"]
        lat = row["lat"]
        country = row["country"]
        pop = row["population"]

        print("id = {}, name = {}, lng = {}, lat = {}".format(id, name, lng, lat))
        count += 1

        redis.hmset("ct:{}".format(id), { "_id" : id, "name" : name, "country" : country, "population" : pop })
        redis.geoadd("idx:cities", lng, lat, id)
        redis.hset("idx:city_by_name", name, id)

`}</code></pre>
    <p>{`Create a file called config.py as shown below:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{` REDIS_CFG = {
        "host" : "localhost",
        "port" : 6379,
        "password" : ""
 }

`}</code></pre>
    <p>{`Ensure that you provide the right host and port details.`}</p>
    <p>{`Execute the script:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` python3 importcities.py
`}</code></pre>
    <p>{`You will see the below results:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` id = 762, name = Labatt Ontario Breweries, lng = -81.2467, lat = 42.9778
 id = 915, name = Ninkasi Brewing, lng = -123.11, lat = 44.0569
 id = 930, name = Oaken Barrel Brewing, lng = -86.0901, lat = 39.615
 Import of 16790 records completed

`}</code></pre>
    <p>{`If you want to simulate slowlogs, then consider using KEYS command. It is always recommended NOT TO USE `}<a parentName="p" {...{
        "href": "https://redis.io/commands/keys"
      }}>{`KEYS`}</a>{` in your regular application code. If you're looking for a way to find keys in a subset of your keyspace, consider using `}<a parentName="p" {...{
        "href": "https://redis.io/commands/scan"
      }}>{`SCAN`}</a>{` or `}<a parentName="p" {...{
        "href": "https://redis.io/topics/data-types#sets"
      }}>{`sets`}</a>{`.`}</p>
    <p>{`The KEYS command may ruin performance when it is executed against large databases`}</p>
    <p>{`Let us try to run KEYS * in RedisInsight CLI and see if it generates slowlog as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image4.png").default} title="image_tooltip" /></p>
    <p>{`Run it one more time and you will notice below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} title="image_tooltip" /></p>
    <p>{`Try decreasing the execution time(50 ms), and you will notice that the below run query also gets logged into the slowlog `}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-7-configuring-the-execution-time"
    }}>{`Step 7. Configuring the execution time`}</h2>
    <p>{`Each entry in the slowlog contains four fields: a slowlog entry ID, the Unix timestamp of when the command was run, the execution time in microseconds, and an array with the command itself, along with any arguments. See the example output below:`}</p>
    <p>{`In order to retrieve the slowlog queries, you have to use SLOWLOG GET X. Where X is the number of slow queries you want to retrieve.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} title="image_tooltip" /></p>
    <p>{`As shown above, the result displays a unique id, timestamp, time taken to execute the query in microseconds, and the actual command + parameter executed. It is important to note that  the Slow log is transient; there's no persistence for it so in the case of failover, the slowlog is lost. If you are looking to rely on a persistent slowlog, you'll be wanting to reconsider your design choices`}</p>
    <p>{`Please note: If I choose “0” it forces the logging of every command while “-1” disabled the slowlog.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image8.png").default} title="image_tooltip" /></p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image9.png").default} title="image_tooltip" /></p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`In a clustered database, each node can have different values for slowlog.  You will need to use the configuration tool in order to configure slowlog for clustered databases.`}</p></div></div>
    <h2 {...{
      "id": "additional-links"
    }}>{`Additional Links`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
        }}>{`Explore Redis keys using RedisInsight browser tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/memoryanalyzer"
        }}>{`Memory Analysis using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/redisearch"
        }}>{`Unified Search and Analytics using RediSearch Browser Tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/redistimeseries"
        }}>{`Managing time-series data using RedisTimeSeries Browser Tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/profiler"
        }}>{`Analyze Your Redis commands using RedisInsight Profiler tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/slowlog"
        }}>{`Debugging Redis using RedisInsight Slowlog Tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/streams"
        }}>{`Using Redis Streams with RedisInsight`}</a></li>
    </ul>
    </MDXLayout>;
}

;
